function App() {
	return (
		<div className={Style.App}>
			{/* <div className={Style.Header}>
				<img className={Style.LogoSmall} src={LogoSmall} alt='Find Firm LLC logo' />
			</div> */}
			<section className={Style.SlidingBanner}>
				<div className={Style.Overlay}></div>
